import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Header from "../layouts/Header";
import Footer from "../layouts/Footer";
import Survey from "../Survey";

//Main component that contains Survey and Survey results button
function Home() {
  return (
    <div className="App">
      <Header />
      <Survey />
      <button className="button-one">
        <strong>Fill out Survey</strong>
      </button>
      <br />
      <button className="button-one">
        <strong>View Survey Results</strong>
      </button>
      <Footer />
    </div>
  );
}

export default Home;
